import React from "react";
import { withUser } from "../Auth/withUser";

const Profile = (props) => {
  return (
    <div className="Profile">
      <div>
        <h2>Hello {this.props.username}</h2>
      </div>
      <div>
      <button><NavLink to="/create">Missing</NavLink></button>
      </div>
    </div>
  );
};

export default withUser(Profile);
